import React from 'react'
import BottomNavBar from '../components/BottomNavBar'

const About = () => {
    return (
        <div class="body-spacing">
            <div class="top-bar"><h1 class="top-bar-text">Politician: About</h1></div>
            <BottomNavBar name='about' />
        </div>
    )
}

export default About
